import React from 'react';

const Popular = ({fetchMovies}) => {
  let query= '/discover/movie?sort_by=popularity.desc';
  fetchMovies('discover', query);
  return (
    <div className="title-container">
      <h2>Popular</h2>
    </div>
  )
}

export default Popular;
